INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2715, 'spa', 'planeación, catastro', 'información utilizada para las acciones apropiadas para el uso futuro de la tierra Ejemplos: mapas de uso de la tierra, mapas de zonificación, levantamientos catastrales, propiedad de la tierra ');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2716, 'spa', 'social', 'características de la sociedad y las culturas Ejemplos: asentamientos, antropología, arqueología, educación, creencias tradicionales, costumbres y costumbres, datos demográficos, áreas y actividades recreativas, evaluación del impacto social, delincuencia y justicia, información censal ');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2717, 'spa', 'infraestructura', 'construcciones artificiales Ejemplos de construcción: edificios, museos, iglesias, fábricas, viviendas, monumentos, tiendas, torres, etc.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2718, 'spa', 'transporte', 'medios y ayudas para el transporte de personas y/o mercancías Ejemplos: carreteras, aeropuertos/ferias, rutas marítimas, túneles, cartas náuticas, localización de vehículos o buques, cartas aeronáuticas, ferrocarriles, etc.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2719, 'spa', 'servicios públicos, comunicación', 'sistemas y servicios de energía, agua y residuos e infraestructuras y servicios de comunicaciones Ejemplos: hidroelectricidad, geotermia, energía solar y nuclear, depuración y distribución de agua, recogida y eliminación de aguas residuales, distribución de electricidad y gas, comunicación de datos, telecomunicaciones, radio, redes de comunicaciones');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2801, 'spa', 'sólo geometría', 'objetos geométricos sin estructura adicional que describa la topología.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2802, 'spa', 'topología1D', 'Topología de complejo topológico 1-dimensional - comúnmente llamada topología de "nodo en cadena".');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2803, 'spa', 'gráfico plano', 'Complejo topológico 1-dimensional que es plano. (Una gráfica plana es una gráfica que se puede dibujar en un plano de tal manera que no se crucen dos bordes excepto en un vértice.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2804, 'spa', 'gráfico plano completo', 'Complejo topológico bidimensional que es plano. (Un complejo topológico bidimensional es comúnmente llamado "topología completa" en un entorno 2D cartográfico.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2805, 'spa', 'gráfico de superficie', 'Complejo topológico 1-dimensional que es isomórfico a un subconjunto de una superficie. (Un complejo geométrico es isomórfico a un complejo topológico si sus elementos están en una correspondencia dimensional, uno a uno, y que conserva los límites, entre sí.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2806, 'spa', 'GráficoSuperficieCompleta', 'Complejo topológico bidimensional que es isomórfico a un subconjunto de una superficie.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2807, 'spa', 'topología3D', 'Complejo topológico tridimensional. (Un complejo topológico es un conjunto de primitivas topológicas que se cierran bajo las operaciones fronterizas.)');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2808, 'spa', 'topología completa 3D', 'cobertura completa de un espacio de coordenadas euclidianas en 3D');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 2809, 'spa', 'resumen', 'complejo topológico sin ninguna realización geométrica especificada');
