INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100081, 'spa', 'Colección', 'Una colección es una agregación de elementos. El término colección significa que el recurso se describe como un grupo; sus partes se pueden describir y navegar por separado.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100082, 'spa', 'Base de datos', 'Una base de datos es información codificada en una estructura definida (por ejemplo, listas, tablas y bases de datos) que sirve para el tratamiento automático directo.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100083, 'spa', 'Evento', 'Un evento es una ocurrencia no persistente, basada en el tiempo. Los metadatos para un evento proporcionan información descriptiva que es la base para el descubrimiento del propósito, ubicación, duración, agentes responsables y enlaces a eventos y recursos relacionados. El recurso del tipo de evento puede no ser recuperable si la instancia descrita ha caducado o aún no se ha producido. Ejemplos - exposición, web-cast, conferencia, taller, jornada de puertas abiertas, performance, batalla, juicio, boda, fiesta de té, conflagración.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100084, 'spa', 'Imagen', 'Una imagen es una representación visual principalmente simbólica que no es el texto. Por ejemplo - imágenes y fotografías de objetos físicos, pinturas, grabados, dibujos, dibujos, otras imágenes y gráficos, animaciones e imágenes en movimiento, películas, diagramas, mapas, notación musical. Tenga en cuenta que la imagen puede incluir representaciones electrónicas y físicas.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100085, 'spa', 'Recursos interactivos', 'Un recurso interactivo es un recurso que requiere la interacción del usuario para ser entendido, ejecutado o experimentado. Por ejemplo - formularios en páginas web, applets, objetos multimedia de aprendizaje, servicios de chat, realidad virtual.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100086, 'spa', 'Imagen en movimiento', 'Una serie de representaciones visuales que, cuando se presentan sucesivamente, transmiten una impresión de movimiento. Ejemplos de imágenes en movimiento son: animaciones, películas, programas de televisión, vídeos, zoetropes o resultados visuales de una simulación.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100087, 'spa', 'Objeto Físico', 'Un objeto o sustancia inanimada, tridimensional. Por ejemplo, una computadora, la gran pirámide, una escultura. Tenga en cuenta que las representaciones digitales de, o sustitutos de, estas cosas deben utilizar Imagen, Texto o uno de los otros tipos de imágenes.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100088, 'spa', 'Servicio', 'Un servicio es un sistema que proporciona una o más funciones de valor al usuario final. Algunos ejemplos son: un servicio de fotocopiado, un servicio bancario, un servicio de autenticación, préstamos interbibliotecarios, un servidor Z39.50 o un servidor Web.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100089, 'spa', 'Software', 'El software es un programa de ordenador en su origen o compilado que puede estar disponible para su instalación no transitoria en otra máquina. Para software que sólo existe para crear un entorno interactivo, utilice en su lugar el software interactivo.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100090, 'spa', 'Sonido', 'Un sonido es un recurso cuyo contenido está pensado principalmente para ser renderizado como audio. Por ejemplo, un formato de archivo de reproducción de música, un disco compacto de audio y voz o sonidos grabados.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100091, 'spa', 'Imagen estática', 'Una representación visual estática. Ejemplos de imágenes fijas son: pinturas, dibujos, diseños gráficos, planos y mapas.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 480, 'spa', 'Explorar gráfico', 'gráfico que proporciona una ilustración del conjunto de datos (debe incluir una leyenda para el gráfico)');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 3850, 'spa', 'país', 'país de la dirección física');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('CL', 100092, 'spa', 'Texto', 'Un texto es un recurso cuyo contenido son principalmente palabras para leer. Por ejemplo: libros, cartas, disertaciones, poemas, periódicos, artículos, archivos de listas de correo. Tenga en cuenta que los facsímiles o imágenes de textos son todavía del género texto.');
