INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 1620, 'spa', 'MD_Georectificado', 'cuadrícula cuyas celdas están regularmente espaciadas en un sistema geográfico (es decir, lat/long) o coordenadas de mapa definidas en el Sistema de Referencia Espacial (SRS) para que cualquier celda en la cuadrícula pueda ser geolocalizada dada su coordenada de cuadrícula y el origen de la cuadrícula, espaciado de celdas y orientación.');
