INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 1650, 'spa', 'puntos de esquina', '"ubicación de la tierra en el sistema de coordenadas definido por el Sistema de Referencia Espacial y la coordenada de la cuadrícula de las celdas en los extremos opuestos de la cobertura de la cuadrícula a lo largo de dos diagonales en las dimensiones espaciales de la cuadrícula. Hay cuatro puntos de esquina en una cuadrícula georectificada, se requieren al menos dos puntos de esquina a lo largo de una diagonal');
