INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10001, 'spa', 'título', 'Un nombre dado al recurso. Típicamente, Título será un nombre por el cual el recurso es formalmente conocido.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10002, 'spa', 'creador', 'Una entidad principalmente responsable de hacer el contenido del recurso. Ejemplos de Creador incluyen una persona, una organización o un servicio. Típicamente, el nombre de un Creador debe ser usado para indicar la entidad.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10003, 'spa', 'asunto', 'Un tema del contenido del recurso. Típicamente, el Asunto se expresará como palabras clave, frases clave o códigos de clasificación que describen un tema del recurso. La mejor práctica recomendada es seleccionar un valor de un vocabulario controlado o esquema de clasificación formal.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10004, 'spa', 'descripción', 'Una relación del contenido del recurso. Los ejemplos de descripción incluyen, pero no se limitan a: un resumen, tabla de contenidos, referencia a una representación gráfica del contenido o una cuenta de texto libre del contenido.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10005, 'spa', 'publicador', 'Entidad responsable de la puesta a disposición del recurso. Ejemplos de Publisher incluyen una persona, una organización o un servicio. Normalmente, el nombre de un Editor debe utilizarse para indicar la entidad.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10006, 'spa', 'colaborador', 'Una entidad responsable de hacer contribuciones al contenido del recurso. Ejemplos de contribuyente incluyen una persona, una organización o un servicio. Típicamente, el nombre de un Contribuyente debe ser usado para indicar la entidad.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10007, 'spa', 'fecha', 'Una fecha de un evento en el ciclo de vida del recurso. Normalmente, Date estará asociado con la creación o disponibilidad del recurso. La mejor práctica recomendada para codificar el valor de fecha se define en un perfil de ISO 8601[W3CDTF] e incluye (entre otras) fechas del formulario YYYYY-MM-DD.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10008, 'spa', 'tipo', 'La naturaleza o género del contenido del recurso. El tipo incluye términos que describen categorías generales, funciones, géneros o niveles de agregación para el contenido. La mejor práctica recomendada es seleccionar un valor de un vocabulario controlado (por ejemplo, el vocabulario de tipo DCMI[DCT1]). Para describir la manifestación física o digital del recurso, utilice el elemento FORMATO.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('PN', 4, 'spa', 'ISO 19115 INSPIRE', NULL);
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('PN', 7, 'spa', 'Micka', NULL);
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10009, 'spa', 'formato', 'La manifestación física o digital del recurso. Normalmente, Formato puede incluir el tipo de medio o las dimensiones del recurso. El formato se puede utilizar para identificar el software, hardware u otro equipo necesario para mostrar u operar el recurso. Ejemplos de dimensiones incluyen tamaño y duración. La mejor práctica recomendada es seleccionar un valor de un vocabulario controlado (por ejemplo, la lista de tipos de medios de Internet[MIME] que definen los formatos de medios de comunicación de la computadora).');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10010, 'spa', 'identicador', 'Una referencia inequívoca al recurso dentro de un contexto dado. La mejor práctica recomendada es identificar el recurso por medio de una cadena o número que se ajuste a un sistema de identificación formal. Los sistemas de identificación formal incluyen, entre otros, el Uniform Resource Identifier (URI) (incluido el Uniform Resource Locator (URL)), el Digital Object Identifier (DOI) y el International Standard Book Number (ISBN).');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10011, 'spa', 'fuente', 'Referencia a un recurso del que se deriva el recurso actual. El presente recurso puede derivarse del recurso Fuente en su totalidad o en parte. La mejor práctica recomendada es identificar el recurso referenciado por medio de una cadena o número que se ajuste a un sistema de identificación formal.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10012, 'spa', 'idioma', 'Una lengua del contenido intelectual del recurso. La mejor práctica recomendada es utilizar RFC 3066[RFC3066] que, junto con ISO639[ISO639]), define etiquetas de idioma primario de dos y tres letras con subetiquetas opcionales. Los ejemplos incluyen "en" o "eng" para el inglés,"akk" para el acadio, y "en-GB" para el inglés utilizado en el Reino Unido.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10013, 'spa', 'relación', 'Una referencia a un recurso relacionado. La mejor práctica recomendada es identificar el recurso referenciado por medio de una cadena o número que se ajuste a un sistema de identificación formal.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10014, 'spa', 'cobertura', 'La extensión o alcance del contenido del recurso. Típicamente, la Cobertura incluirá la ubicación espacial (un nombre de lugar o coordenadas geográficas), el período temporal (una etiqueta de período, fecha o rango de fechas) o la jurisdicción (como una entidad administrativa nombrada). La mejor práctica recomendada es seleccionar un valor de un vocabulario controlado (por ejemplo, el Tesauro de Nombres Geográficos[TGN]) y utilizar, cuando proceda, lugares o períodos de tiempo designados en lugar de identificadores numéricos como conjuntos de coordenadas o intervalos de fechas.');
INSERT INTO label (label_type, label_join, lang, label_text, label_help) VALUES ('EL', 10015, 'spa', 'derechos', 'Información sobre los derechos que se tienen sobre el recurso. Típicamente, los Derechos contienen una declaración de gestión de derechos para el recurso, o una referencia a un servicio que proporciona dicha información. La información sobre los derechos a menudo abarca los Derechos de Propiedad Intelectual (DPI), el Derecho de Autor y diversos Derechos de Propiedad Intelectual. Si el elemento Derechos está ausente, no se pueden hacer suposiciones acerca de cualquier derecho que se posea sobre el recurso..');
